unto ao LAF Ibama, em 09/09/2024 (SEI 18912754).','Federal','Obtenção de LP','12422882','2020-10-05','12422966','2021-09-29','13022861','44881','12901945','2022-11-10','02001.022461/2020-19','Aguarda análise/aprovação do RAS','Alta',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-10-04 15:33:10','2024-10-04 15:33:10','{\"type\": \"LineString\", \"coordinates\": [[-64.24252116, -7.46505174], [-64.24321824, -7.46534734]]}'),(22,NULL,'317/AM-452_526','317/AM','317','AM','452','526',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'74','Implantação/Pavimentação','Pavimentação do subtrecho: Boca do Acre/AM - Divisa AM/AC.','93/2022',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Projeto está concluído, mas não tem portaria de aprovação, pois não tem licenças.',NULL,'50600.007511/2019-80','O EIA da BR-317/AM - RV1 foi entregue ao DNIT em 16/07/2024 (SEI 18429569). Aguarda-se a análise do DNIT e respectivo protocolo no IBAMA.\n\nECI - 1º levantamento de campo realizado nas TIs Boca do Acre, Camicuã e Apurinã, em mai/jun.24 e o 2º levantamento de campo realizado em agosto.24 contemplando as demais Tis: Monte/Primavera/Goiaba, Iquirema e Valparaíso.\n\nMalarígeno - realizadas as 3 campanhas de levantamento entomológico: 1ª campanha no auge do período de precipitação (dezembro/23), 2ª campanha no final do período chuvoso (abril/24) e a 3ª campanha no auge da estação seca (julho/24). \nRelatório da 1ª campanha analisado e reprovado pelo DNIT. Prosul está realizando as adequações para reapresentação. Relatórios da 2ª e 3ª campanhas em elaboração.','Federal','Obtenção de LP','3039896','2019-04-18','4545280','2019-11-25','12824901','44858','12965643','2022-11-18','02001.007553/2019-27','Aguardando DNIT analisar/aprovar o EIA para protocolo no IBAMA','Normal','08620.000771/2003-62','PT ECI aprovado','Normal','01450.0027762/2019-47','Normal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL