imento do licenciamento ambiental da rodovia.\"Obtenção do Termo de Referência para EIA/RIMA: Aguardando manifestação do Ibama CGMAB reiterou ofício à Superintendência do Acre solicitando definição quanto ao escopo.','Estadual','Obtenção de LP','19018960','2024-09-19',NULL,NULL,NULL,NULL,NULL,NULL,'02001.021172.2020-94','Aguarda emissão do TR','Normal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-11-06 14:54:56','2024-11-06 14:54:56',NULL),(44,NULL,'282/SC-223,1_650,8','282/SC','282','SC','223.1','650.8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'427.69999999999993',NULL,NULL,'95/2022',NULL,NULL,NULL,'Mata Atlântica',NULL,NULL,NULL,'Edital na fase de habilitação.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-11-06 14:54:56','2024-11-06 14:54:56',NULL),(45,NULL,'163/SC/RS-0_34','163/SC/RS','163','SC','0','34',NULL,NULL,'163','RS','0','24.9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'58.9','Implantação/Pavimentação','Implantação de obra de arte especial e acessos, e projetos básico e executivo de engenharia visando a adequação de capacidade com melhoria de segurança e eliminação de pontos críticos.','95/2022','Apostila','18965794','2024-09-16','Mata Atlântica','50600.020493/2022-27','50600.020493/2022-27','00 00522/2022','Contrato nº 00 00522/2022: Elaboração de Projeto Básico da Ponte sobre o Rio Uruguai e o EVTEA visando a federalização da SC-163 (km 0 ao 34). SR informou que há uma grande pressão do estado para federalizar o trecho. DPP informou que deverá fazer aditivo do contrato.',NULL,'50600.009137/2024-14','FCA protocolada no IBAMA (SEI DNIT 17364237 e 18005095).\n#\nIBAMA emitiu Parecer Técnico nº 182/2024-Cotra/CGLin/Dilic (interno)sugerindo a adoção do rito ordinário trifásico (LP, LI